INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (1, 73000, 0, N'Cần người sửa nhà', N'Nhà bị hư nặng nề cần người sửa giúp, thanh toán nhanh gọn lẹ', N'RRsJl8Aj', N'hoandps18107')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (2, 44000, 5, N'Mì Quảng', N'Mì Quảng là sự kết hợp của mì sợi và mì trứng vàng, ăn kèm với nước luộc thịt đậm đà cùng với các loại rau thơm như: bắp chuối, xà lách, ngò gai, hành lá và rau mùi.', N'RRsAyJLv', N'hoandps18107')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (3, 1000000, 5, N'Cần mua điện thoại cũ', N'Mình đang thu gom các loại điện thoai cũ về để lấy linh kiện, ai có liên hệ với mình, cảm ơn.', N'RRsOLk4J', N'hoandps18107')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (4, 2000000, 5, N'Cần tìm việc làm thời vụ', N'Tui rảnh từ giờ tới cuối tháng, ai có công việc gì cho tui theo làm với. Có sức khỏe và kinh nghiệm làm việc sales', N'RRsGoaSE', N'hoandps18107')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (5, 32000, 5, N'Bánh canh hẹ Phú Yên', N'Bánh canh hẹ nóng hổi với phần nước dùng đậm đà và vị ngọt thanh của hẹ, xương ống. Chả cá được làm từ nhiều loại cá khác nhau và chiên lên. Do đó khi ăn bạn sẽ cảm nhận được vị ngọt, béo và dai dai của cá.', N'RRsAyJLv', N'quochnps18066')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (6, 8000000, 0, N'Tuyển nhân viên phục vụ', N'Quán sắp mở cần tìm nhân viên chính thức, lương trả theo tuần và có chỗ nghỉ lại cho nhân viên', N'RRsoMzSO', N'quochnps18066')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (7, 42000, 0, N'Don Quảng Ngãi', N'Hương vị nguyên sơ, tươi ngọt còn vương vấn nơi đầu lưỡi, cắn thêm một trái ớt sim là tuyệt không còn gì để tả. Món này ăn ngon nhất là vào mùa đông, trời lạnh mà được thưởng thức tô don nóng hổi thì còn gì bằng?!', N'RRsAyJLv', N'quochnps18066')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (8, 39000, 0, N'Cháo lươn Nghệ An', N'Cháo lươn thì không khó kiếm, nhưng tìm được một nơi làm cháo lươn ngon đậm đà và khác biệt như ở Nghệ An thì không hề dễ. Dần dần, món cháo lươn trở thành một nét độc đáo trong văn hóa ẩm thực Nghệ An', N'RRsAyJLv', N'quochnps18066')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (9, 800000, 5, N'Mình cần mua một điện thoại', N'Cần điện thoại chữa cháy giá tầm 1tr, chỉ cần nghe gọi và online các mạng xã hội', N'RRsOLk4J', N'quochnps18066')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (10, 55000, 10, N'Bánh căn', N'Bánh căn là một trong những món ăn đặc sản miền Trung. Bánh căn thường được làm ở các tỉnh ven biển miền Trung. Bánh căn được làm từ bột gạo và được chế biến trên các vỉ nướng ngoài trời được trang bị khuôn bánh làm từ đất nung chuyên dụng.', N'RRsAyJLv', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (11, 400000, 0, N'Mai cần người đi công trường', N'Thiếu 5 bạn đi công trường, công việc là lắp ráp mái nhà 400/ngày. Nhận lương cuối ca', N'RRsGoaSE', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (12, 74000, 0, N'Bánh đập', N'Nhiều người giải thích cái tên độc lạ đó là vì cái bánh tráng nướng thường cong vênh, cái bánh tráng ướt khó tiếp cận những chỗ trũng nên người ăn hay dùng tay "đập đập" để hai cái bánh tráng kết dính với nhau thêm một lần nữa', N'RRsAyJLv', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (13, 50000, 5, N'Bánh bột lọc Huế', N'Một trong những đặc sản Huế làm nên tinh hoa ẩm thực cố đô, không thể không nhắc tới món bánh bột lọc Huế, từ cách làm đến hương vị rất đặc biệt, sẽ không hề giống với bất cứ đâu. Có thể nói, Huế là cái nôi của món bánh bột lọc', N'RRsAyJLv', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (14, 36000, 0, N'Gỏi cá Nam Ô', N'Gỏi cá Nam Ô được đặt tên theo tên của làng chài Nam Ô. Nam Ô, Đà Nẵng là nơi đánh bắt cá nên cá ở đây lúc nào cũng tươi ngon. Cá thường dùng để làm gỏi cá Nam Ô là cá trích mai do thịt cá rất ngọt và mềm.', N'RRsAyJLv', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (15, 5000000, 0, N'Nhóm sinh viên tìm việc làm', N'Nhóm mình có 5 thành viên, vì muốn làm việc chung nên cần tìm công ty tuyển đủ 5 người vào làm', N'GLVPdKpn', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (16, 77000, 0, N'Gỏi quả vả', N'Quả vả cùng  với tôm, thịt luộc chín xắt nhỏ. Nước mắm, ớt, tỏi, đường, bột ngọt, chanh trộn với nhau thành một hỗn hợp hơi sệt, sau đó trộn đều nguyên liệu cùng rau răm, mè rang và chút dầu lạc phi hành.', N'RRsAyJLv', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (17, 39000, 10, N'Cần mua xe giá tầm 🛵50tr', N'Cần chiếc tay côn giá tầm 50tr, ae có xe hoặc tu vấn tui với', N'RRs6Oe5x', N'seller1')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (18, 32000, 10, N'Gỏi củ cải', N'Đem củ cải trắng, cà rốt, khế bào mỏng vắt sạch nước, thịt (hoặc tôm) vào trộn cùng với nước mắm ớt chua ngọt, thêm chút dầu lạc phi hành, rau thơm, đậu phụng vào, trộn đều', N'RRsAyJLv', N'seller2')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (19, 500000, 0, N'Ai biết là cây 🍀 gì không ạ?', N'Vì bé Na 🐍 nhà mình hít thở không đều, ngáy khò khè suốt ngày nên mình cần cây như hình cho bé hít qua ngày. Mình thương bé Nak lắm 🤣.', N'RRsgiZoD', N'seller2')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (20, 3000000, 5, N'Mình tìm trọ giá tầm 3 tr', N'Cần tìm phòng cho 5 con đầu đen ở, giá tầm 2tr5- 3tr5, yêu cầu có wifi + nước tính theo người nha.', N'RRsClril', N'seller3')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (21, 20000000, 5.5, N'Mình bán xe do kẹt tiền', N'Chiếc vision năm 2021 bán lại do cần tiền mở quán', N'RRs6Oe5x', N'seller3')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (22, 74000, 0, N'Bánh ít lá gai', N'Bánh ít lá gai là một món bánh đặc sản thơm ngon của Xứ Nẫu. Trong một chiếc bánh là sự kết hợp hài hòa giữ vị ngọt của đường, vị bùi của đậu xanh cùng với dừa béo và nếp dẻo. Cách làm bánh này không khó, chỉ cần một chút khéo léo, kiên nhẫn', N'RRsAyJLv', N'seller3')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (23, 1000000, 0, N'Mua điện thoại hư hoặc cũ', N'Mua điện thoại hư, cũ để lấy linh kiện ⌨, Ai có thiết bị điện tử bị hư, hỏng bán lại cho tui, tui lấy linh kiện thay thế', N'RRsCDYd3', N'seller3')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (24, 45000, 15, N'Kẹo mè xửng Huế', N'Đặc sản mè xửng Huế có tên gọi theo nguyên liệu chính là mè và cách làm xửng (cách hoán đường cô đặc dẻo). Ngoài mè (vừng) thì mạch nha, đậu phong hay bánh đa cũng là những thành phần của mè xửng.', N'RRsAyJLv', N'seller3')
INSERT [dbo].[PRODUCTS] ([id], [cosPrice], [proPrice], [name], [descript], [category_id], [account_id]) VALUES (25, 38000, 15, N'Cao lầu Hội An', N'Một tô cao lầu Hội An sẽ có xá xíu được tẩm ướp đậm đà, thịt mềm với màu đỏ gạch vô cùng hấp dẫn. Cao lầu được cắt thành những miếng vuông được chiên vàng giòn rồi rắc thêm chút đậu phộng và rưới nước sốt lên, thưởng thức', N'RRsAyJLv', N'seller3')
